","keccak256":"0xa1e8e83cd0087785df04ac79fb395d9f3684caeaf973d9e2c71caef723a3a5d6","license":"MIT"},"contracts/PepeDisc.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.18;
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/cryptography/MerkleProof.sol";
import "erc721a/contracts/ERC721A.sol";

contract PepeDisc is ERC721Enumerable, Ownable {
    bool public saleIsActive = false;
    uint256 public listingPrice = 0.0069 ether;
    uint256 public freeMintablePerDrive = 3;
    string private _nftBaseURI;
    address public pepeStakingAddress;
    address public pepeDriveIIAddress;
    address public pepeCharacterAddress;
    address public team1;
    address public team2;

    event DiscTypeGenerated(DiscType discType);

    enum DiscType {
        FARMER,
        BULL,
        BEAR
    }

    struct DiscDetails {
        DiscType tokenType;
        uint discLevel;
    }

    mapping(uint => uint) public freePerDriveID;
    mapping(uint => DiscDetails) public discDetails;

    constructor(address team1_, address team2_) ERC721("PepeDisc", "PD") {
        team1 = team1_;
        team2 = team2_;
    }

    function setBaseURI(string calldata nftBaseURI_) public onlyOwner {
        _nftBaseURI = nftBaseURI_;
        //todo metadata onchain
    }

    function setPepeStakingAddress(
        address pepeStakingAddress_
    ) public onlyOwner {
        pepeStakingAddress = pepeStakingAddress_;
    }

    function increaseDiscLevel(uint discID_) public {
        require(
            msg.sender == pepeStakingAddress,
            "only staker can increase level"
        );
        discDetails[discID_].discLevel += 1;
    }

    function returnDiscLevel(uint discID_) public view returns (uint) {
        return discDetails[discID_].discLevel;
    }

    function returnDiscType(uint discID_) public view returns (DiscType) {
        return discDetails[discID_].tokenType;
    }

    function setPepeCharacterAddress(
        address pepeCharacterAddress_
    ) public onlyOwner {
        pepeCharacterAddress = pepeCharacterAddress_;
    }

    function setPepeDriveIIAddress(
        address pepeDriveIIAddress_
    ) public onlyOwner {
        pepeDriveIIAddress = pepeDriveIIAddress_;
    }

    function setTeam(address[] calldata team) public onlyOwner {
        require(team.length == 2, "Need two team members");
        team1 = team[0];
        team2 = team[1];
    }

    function setFreeMintablePerDrive(
        uint freeMintablePerDrive_
    ) public onlyOwner {
        freeMintablePerDrive = freeMintablePerDrive_;
    }

    function checkFreePerDriveID(uint driveID_) public view returns (uint) {
        return (3 - freePerDriveID[driveID_]);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return _nftBaseURI;
    }

    function flipSaleState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }

    function setListingPrice(uint256 listingPrice_) public onlyOwner {
        listingPrice = listingPrice_;
    }

    function withdraw() public onlyOwner {
        uint256 _balance = address(this).balance;
        uint256 split = (_balance * 50) / 100;
        (bool os, ) = payable(team1).call{value: split}("");
        require(os);

        (os, ) = payable(team2).call{value: split}("");
        require(os);
    }

    function burnFromContract(uint discID_) public {
        require(
            msg.sender == pepeStakingAddress ||
                msg.sender == pepeCharacterAddress,
            "only burnable from game"
        );
        _burn(discID_);
    }

    function mintFreeWithDrive(uint256 amount_, uint driveID_) public {
        ERC721A pepeDriveII = ERC721A(pepeDriveIIAddress);
        require(saleIsActive, "sale is not open");
        require(
            amount_ + freePerDriveID[driveID_] <= 3,
            "drive can't mint more"
        );
        require(
            pepeDriveII.ownerOf(driveID_) == msg.sender,
            "you have to own that drive!"
        );

        freePerDriveID[driveID_] += amount_;

        uint id = totalSupply();
        for (uint i = 0; i < amount_; i++) {
            discDetails[id].tokenType = determineType(id, msg.sender);
            _safeMint(msg.sender, id);
            id++;
        }
    }

    function tokensOfOwner(
        address _owner
    ) public view returns (uint256[] memory) {
        uint256 tokenCount = balanceOf(_owner);

        uint256[] memory tokensId = new uint256[](tokenCount);
        for (uint256 i; i < tokenCount; i++) {
            tokensId[i] = tokenOfOwnerByIndex(_owner, i);
        }
        return tokensId;
    }

    function mintPayed(uint256 amount_) public payable {
        require(saleIsActive, "Sale is not open");
        require(
            msg.value >= (listingPrice * amount_),
            "Not enough funds submitted"
        );

        uint id = totalSupply();
        for (uint i = 0; i < amount_; i++) {
            discDetails[id].tokenType = determineType(id, msg.sender);
            _safeMint(msg.sender, id);
            id++;
        }
    }

    function determineType(
        uint discID_,
        address initiator_
    ) internal returns (DiscType) {
        uint256 randomNumber = random(discID_, initiator_);

        DiscType discType;
        if (randomNumber % 100 < 90) {
            discType = DiscType.FARMER;
        } else if (randomNumber % 100 < 99) {
            discType = DiscType.BULL;
        } else {
            discType = DiscType.BEAR;
        }

        emit DiscTypeGenerated(discType);
        return discType;
    }

    function random(
        uint256 discId_,
        address initiator_
    ) internal view returns (uint pseudoRandomness) {
        pseudoRandomness = uint(
            keccak256(
                abi.encodePacked(
                    blockhash(block.number - 1),
                    discId_,
                    initiator_
                )
            )
        );

        return pseudoRandomness;
    }

    function isApprovedForAll(
        address owner,
        address operator
    ) public view virtual override(ERC721, IERC721) returns (bool) {
        if (operator == pepeStakingAddress) {
            return true;
        }
        return super.isApprovedForAll(owner, operator);
    }
}
